import React from 'react';
import Page from 'components/Page';
import 'styles/components/_database.scss';
import FadeIn from 'components/FadeIn';
import csvFile from 'data/data_labeled.csv';
import Table, { AvatarCell, SelectColumnFilter, StatusPill } from 'components/Table/Table'
import {csv} from 'd3-fetch';

class DatabasePage extends React.Component {


  constructor() {
    super();

    //this.read_csv=this.read_csv.bind(this);

  }

  async read_csv() {

    var dataList = [];

    await csv(csvFile).then((data) => {
      data.forEach(function(article) {
        var dic = {};
        dic["name"]=article["headline"];
        dic["department"]="url";
        dic["status"]="topic";
        dic["label"]=article["label"];
        dic["year"]=article["2020"];
        dic["journal"]=article["journal"];

        dataList.push(dic);
    })
    });

   console.log(dataList)

   return dataList


  }


  render() {
  return (
    <Page>
    <Row >
    <div style={{backgroundImage:'linear-gradient(#ffd639,white)', width:"100%"}}>
    <FadeIn>
      <p className="databaseTitle">Todos os artigos</p>
      </FadeIn> 
      <FadeIn>
      <p className="databaseSubheading">
        Os principais recursos e referências referentes a este projeto podem ser encontrados abaixo.
      </p>
      </FadeIn>
        <div className="divTable">
        <Table columns={columns} data={data} />
        </div>



    </div>
    </Row>
    </Page>
  );
  }
}

const columns = [
  {
    Header: "Título",
    accessor: 'name',

  },
  {
    Header: "Url",
    accessor: 'department',
  },
  {
    Header: "Status",
    accessor: 'status',
    Filter: SelectColumnFilter,  // new
    filter: 'includes',
    Cell: StatusPill,
  },
  {
    Header: "Ano",
    accessor: 'year',
    Filter: SelectColumnFilter,  // new
    filter: 'includes',

  },
  {
    Header: "Jornal",
    accessor: 'journal',
    Filter: SelectColumnFilter,  // new
    filter: 'includes',
  },
  {
      Header: "Sentido",
    accessor: 'label',
      Filter: SelectColumnFilter,  // new
      filter: "includes",
